import React, { Component, Fragment } from "react";

export default function Counter() {
    const state = {
        count : 0,
        imageUrl : "file:///root/Videos/agriculture-economy.png"
    };
  return (
    <Fragment>
      <h3>My Calculator</h3>
      <img src={state.imageUrl} alt=""/>
      <div class="sel">Select any of the operations</div>
      <div>{state.count}</div>
      <button class="btn">Increment</button>
    </Fragment>
  );
}

